from typing import List
from collections import defaultdict, Counter

class Solution:
  # Solution 1:
  def findSubstring(self, s: str, words: List[str]) -> List[int]:
    wordCount, wordLength = len(words), len(words[0])
    wordDict = defaultdict(int)
    res = []
    for word in words:
      wordDict[word] += 1      
    
    for i in range(len(s) - (wordCount * wordLength) + 1):
      wordSeen = defaultdict(int)
      possible = True

      for j in range(wordCount):
        word = s[i + (j * wordLength): i + (j * wordLength) + wordLength]
        wordSeen[word] += 1
        if wordSeen[word] > wordDict[word]:
          possible = False
          break

      if possible:
        res.append(i)
        
    return res

